import { all } from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import AllPool from "./AllPool";
import './poolhome.css';

function PoolHome() {
  const navigate = useNavigate();
  const [section, setSection] = useState("1");
  const [allPool, setallPool] = useState([]);

  console.log(section);
  useEffect(() => {
    fetch("http://localhost:8081/allpool")
      .then((response) => response.json())
      .then((data) => setallPool(data))
      .catch((error) => console.log(error));
  }, []);

  return (
    <>
    <div>
      <div className="outerbuttondiv">
      <button className="buttondiv"
        onClick={() => {
          setSection("1");
        }}
      >
        Available Pools
      </button>
      <button className="buttondiv"
        onClick={() => {
          setSection("2");
        }}
      >
        My Pools
      </button>
      <button className="buttondiv"
        onClick={() => {
          setSection("3");
        }}
      >
        Joined Pools
      </button>
      <button className="buttondiv"
        onClick={() => {
          setSection("4");
        }}
      >
        Create Pool
      </button>

      </div>
    

      <div>
        {(() => {
          switch (section) {
            case "1":
              return (
                <>
                  {
                    allPool.length > 0 ? <AllPool allPool={allPool} />: null
                  }
                </>
              );

            case "2":
              return (
                <>
                  <div>These are my pools</div>
                </>
              );

            case "3":
              return (
                <>
                  <div>These are my joined pools</div>
                </>
              );
            default:
              return (
                <>
                  {
                    allPool.length > 0 ? <AllPool allPool={allPool} />: null
                  }
                </>
              );
          }
        })()}
      </div>

      <div>
        <button
          onClick={() => {
            navigate("/signup");
          }}
        >
          LOGOUT
        </button>
      </div>
      </div>
    </>
  );
}

export default PoolHome;
